export const questions = [
    {
        id: 0,
        question: 'Age',
        options: ['I am clear about my return and time horizon', 
                    'I am unsure and would like to be guided']
    },

    {
        id: 1,
        question: 'This money is invested for...',
        options: ['less than 2 years', 
                    'from 2 to 5 years',
                    'more than 5 years']
    },

    {
        id: 2,
        question: 'Target returns',
        options: ['6%', 
                    '12%',
                    '18%']
    },

    {
        id: 3,
        question: 'I care about...',
        options: ['I care about my return target', 
                    'I care about managing risk']
    },

    {
        id: 4,
        question: 'I read',
        options: ['Market News', 
                    'Entertainment & Sport News']
    },

    {
        id: 5,
        question: 'I would prefer...',
        options: ['Staggered or systematic investing (gradual)', 
                    'One-time investment']
    }
]
